import React from 'react';
import Aux from "./Auxliliary/Auxiliary"
import './App.css';

function App() {
  let today = new Date().toLocaleDateString()
  var todaytime = new Date();
  var time = todaytime.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();

  return (
    <Aux>
    <h1>Hello My name is Dunya</h1>
    <p>Today Date {today}</p>
    <p>Current Time is {`${time}`} </p>

    </Aux>

  );

}

export default App;
